// src/components/EasterEgg.js
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

const EasterEgg = () => {
  const [glitchText, setGlitchText] = useState(false);
  const [eyeBlink, setEyeBlink] = useState(false);

  useEffect(() => {
    // Efeito de glitch no texto
    const glitchInterval = setInterval(() => {
      setGlitchText(prev => !prev);
    }, 3000);

    // Efeito de piscar do olho
    const blinkInterval = setInterval(() => {
      setEyeBlink(true);
      setTimeout(() => setEyeBlink(false), 200);
    }, 5000);

    return () => {
      clearInterval(glitchInterval);
      clearInterval(blinkInterval);
    };
  }, []);

  return (
    <div className="min-h-screen bg-black flex items-center justify-center p-4 overflow-hidden">
      {/* Overlay de Ruído */}
      <div className="fixed inset-0 bg-noise opacity-5 pointer-events-none"></div>

      <div className="bg-zinc-900 max-w-[400px] w-full p-8 rounded border border-red-900/30 shadow-2xl shadow-red-900/20 relative animate-pulse-slow">
        {/* Faixa vermelha de aviso */}
        <div className="absolute -top-3 left-0 right-0 h-1 bg-red-600 animate-pulse"></div>
        
        <div className="space-y-8 relative">
          <h1 className={`text-2xl font-mono font-black text-red-600 text-center tracking-wide ${glitchText ? 'glitch' : ''}`}>
            ÁREA DE DÉJÀ VU
          </h1>
          
          <p className="text-center font-mono text-red-200/80 text-base leading-tight blur-sm hover:blur-none transition-all duration-500">
            ESTA NÃO É SUA PRIMEIRA VEZ AQUI.
          </p>

          <p className="text-center font-mono text-red-200/80 text-base leading-tight">
            VOCÊ JÁ ESTEVE AQUI ANTES.
            <br />
            VOCÊ SEMPRE ESTEVE AQUI.
          </p>

          <div className="bg-red-950 h-[150px] rounded-sm relative flex items-center justify-center overflow-hidden">
            <div className="absolute inset-0 bg-[radial-gradient(circle,transparent_20%,#000_70%)]"></div>
            <svg 
              viewBox="0 0 100 100" 
              className={`w-32 h-32 absolute transition-transform duration-1000 ${eyeBlink ? 'scale-y-0' : 'scale-100'}`}
              fill="none"
              stroke="none"
            >
              {/* Círculo externo (aura vermelha) */}
              <circle cx="50" cy="50" r="45" className="animate-pulse-slow" fill="#7f1d1d" opacity="0.3" />
              
              {/* Olho principal */}
              <circle cx="50" cy="50" r="25" fill="#111" stroke="#7f1d1d" strokeWidth="2" />
              <circle cx="50" cy="50" r="20" fill="#300" />
              <circle cx="50" cy="50" r="10" fill="#000" />
              <circle cx="45" cy="45" r="3" fill="#ff2525" className="animate-pulse" />

              {/* Veias no olho */}
              {[0, 60, 120, 180, 240, 300].map((rotation) => (
                <path
                  key={rotation}
                  d={`M50,50 L${50 + 40 * Math.cos(rotation * Math.PI / 180)},${50 + 40 * Math.sin(rotation * Math.PI / 180)}`}
                  stroke="#600"
                  strokeWidth="1"
                  opacity="0.5"
                />
              ))}
            </svg>
          </div>

          <p className="text-center font-mono text-red-200/80 text-base leading-tight glitch-text">
            ELE ESTÁ OBSERVANDO
            <br />
            ELE SEMPRE ESTEVE OBSERVANDO
          </p>

          <Link to="/">
            <p className="text-center text-xs font-mono text-red-400 hover:text-red-600 transition-all duration-300 mt-4 cursor-pointer glitch-text">
              RETORNE... ENQUANTO AINDA PODE.
            </p>
          </Link>
        </div>

        {/* Scanlines overlay */}
        <div className="absolute inset-0 pointer-events-none scanlines"></div>
      </div>

      <style jsx="true">{`
        @keyframes noise {
          0%, 100% { transform: translate(0, 0); }
          10% { transform: translate(-5%, -5%); }
          20% { transform: translate(-10%, 5%); }
          30% { transform: translate(5%, -10%); }
          40% { transform: translate(-5%, 15%); }
          50% { transform: translate(-10%, 5%); }
          60% { transform: translate(15%, 0); }
          70% { transform: translate(0, 10%); }
          80% { transform: translate(-15%, 0); }
          90% { transform: translate(10%, 5%); }
        }

        .bg-noise {
          background-image: url("data:image/svg+xml,%3Csvg viewBox='0 0 300 300' xmlns='http://www.w3.org/2000/svg'%3E%3Cfilter id='noiseFilter'%3E%3CfeTurbulence type='fractalNoise' baseFrequency='0.85' numOctaves='3' stitchTiles='stitch'/%3E%3C/filter%3E%3Crect width='100%' height='100%' filter='url(%23noiseFilter)'/%3E%3C/svg%3E");
          animation: noise 0.5s infinite;
        }

        .scanlines::before {
          content: "";
          position: absolute;
          width: 100%;
          height: 100%;
          background: repeating-linear-gradient(
            transparent 0%,
            rgba(255, 0, 0, 0.1) 0.5%,
            transparent 1%
          );
        }

        .glitch {
          animation: glitch 1s infinite;
          position: relative;
        }

        @keyframes glitch {
          0% { transform: none; opacity: 1; }
          7% { transform: skew(-0.5deg, -0.9deg); opacity: 0.75; }
          10% { transform: none; opacity: 1; }
          27% { transform: none; opacity: 1; }
          30% { transform: skew(0.8deg, -0.1deg); opacity: 0.75; }
          35% { transform: none; opacity: 1; }
          52% { transform: none; opacity: 1; }
          55% { transform: skew(-1deg, 0.2deg); opacity: 0.75; }
          50% { transform: none; opacity: 1; }
          72% { transform: none; opacity: 1; }
          75% { transform: skew(0.4deg, 1deg); opacity: 0.75; }
          80% { transform: none; opacity: 1; }
          100% { transform: none; opacity: 1; }
        }

        .animate-pulse-slow {
          animation: pulse 4s cubic-bezier(0.4, 0, 0.6, 1) infinite;
        }

        @keyframes pulse {
          0%, 100% { opacity: 1; }
          50% { opacity: .5; }
        }
      `}</style>
    </div>
  );
};

export default EasterEgg;
